Currently this is quite a complex process, but we're working on making it a little bit smoother. You start by installing the 'compiler-tester' repo (see its README.md instructions for details) - it is quite heavy as it needs the LLVM etc etc. Afterwards, you can look at one of the tests (for example tests/solidity/simple/default.sol ). //! { "cases": [ {
//! "name": "first",
//! "inputs": [
//! {
//! "method": "first",
//! "calldata": [
//! ]
//! }
//! ],
//! "expected": [
//! "42"
//! ]
//! }, ] } // SPDX-License-Identifier: MIT pragma solidity >=0.4.16; contract Test { function first() public pure returns (uint64) { uint64 result = 42; return result; }
} As you can see - it is self-contained - it has the solidity code at the bottom, and the top comments are used to define the test case - and expected result. You can run it by calling: cargo run --release --bin compiler-tester -- -DT \ --path='tests/solidity/simple/default.sol' \ --mode='Y+M3B3 0.8.19' And then collect the detailed tracing information from trace directory. You'll notice that you have 2 files for each test - one covering the deployment, and one covering the test run. You can take test run one and upload it to our debugger to see detailed zkAssembler and state of memory, heap, stack and registers at each execution step.

