Technically, this L1 smart contract acts as a connector between Ethereum (L1) and a single L2. It checks the validity proof and data availability, handles L2 <-> L1 communication, finalizes L2 state transition, and more. diamondProxy.png DiamondProxy The main contract uses EIP-2535 diamond proxy pattern. It is an in-house implementation that is inspired by the mudgen reference implementation . It has no external functions, only the fallback that delegates a call to one of the facets (target/implementation contract). So even an upgrade system is a separate facet that can be replaced. One of the differences from the reference implementation is access freezable. Each of the facets has an associated parameter that indicates if it is possible to freeze access to the facet. Privileged actors can freeze the diamond (not a specific facet!) and all facets with the marker isFreezable should be inaccessible until the governor or admin unfreezes the diamond. Note that it is a very dangerous thing since the diamond proxy can freeze the upgrade system and then the diamond will be frozen forever. The diamond proxy pattern is very flexible and extendable. For now, it allows splitting implementation contracts by their logical meaning, removes the limit of bytecode size per contract and implements security features such as freezing. In the future, it can also be viewed as EIP-6900 for ZK Stack , where each ZK Chain can implement a sub-set of allowed implementation contracts. GettersFacet Separate facet, whose only function is providing view and pure methods. It also implements diamond loupe which makes managing facets easier. This contract must never be frozen. AdminFacet Controls changing the privileged addresses such as governor and validators or one of the system parameters (L2 bootloader bytecode hash, verifier address, verifier parameters, etc), and it also manages the freezing/unfreezing and execution of upgrades in the diamond proxy. The admin facet is controlled by two entities: Governance - Separate smart contract that can perform critical changes to the system as protocol upgrades. This contract controlled by two multisigs, one managed by Matter Labs team and another will be multisig with well-respected contributors in the crypto space. Only together they can perform an instant upgrade, the Matter Labs team can only schedule an upgrade with delay. Admin - Multisig smart contract managed by Matter Labs that can perform non-critical changes to the system such as granting validator permissions. Note, that the Admin is the same multisig as the owner of the governance. MailboxFacet The facet that handles L2 <-> L1 communication, an overview for which can be found in docs . The Mailbox performs three functions: L1 <-> L2 communication. Bridging native Ether to the L2 (with the launch of the Shared Bridge this will be moved) Censorship resistance mechanism (in the research stage). L1 -> L2 communication is implemented as requesting an L2 transaction on L1 and executing it on L2. This means a user can call the function on the L1 contract to save the data about the transaction in some queue. Later on, a validator can process it on L2 and mark it as processed on the L1 priority queue. Currently, it is used for sending information from L1 to L2 or implementing multi-layer protocols. NOTE : While user requests the transaction from L1, the initiated transaction on L2 will have such a msg.sender: address sender = msg.sender; if (sender != tx.origin) { sender = AddressAliasHelper.applyL1ToL2Alias(msg.sender); } where uint160 constant offset = uint160(0x1111000000000000000000000000000000001111); function applyL1ToL2Alias(address l1Address) internal pure returns (address l2Address) { unchecked { l2Address = address(uint160(l1Address) + offset); }
} For most of the rollups the address aliasing needs to prevent cross-chain exploits that would otherwise be possible if we simply reused the same L1 addresses as the L2 sender. In zkEVM address derivation rule is different from the Ethereum, so cross-chain exploits are already impossible. However, the zkEVM may add full EVM support in the future, so applying address aliasing leaves room for future EVM compatibility. The L1 -> L2 communication is also used for bridging ether. The user should include a msg.value when initiating a transaction request on the L1 contract. Before executing a transaction on L2, the specified address will be credited with the funds. To withdraw funds user should call withdraw function on the L2EtherToken system contracts. This will burn the funds on L2, allowing the user to reclaim them through the finalizeEthWithdrawal function on the MailboxFacet. More about L1->L2 operations can be found here . L2 -> L1 communication, in contrast to L1 -> L2 communication, is based only on transferring the information, and not on the transaction execution on L1. The full description of the mechanism for sending information from L2 to L1 can be found here . ExecutorFacet A contract that accepts L2 batches, enforces data availability and checks the validity of zk-proofs. The state transition is divided into three stages: commitBatches - check L2 batch timestamp, process the L2 logs, save data for a batch, and prepare data for zk-proof. proveBatches - validate zk-proof. executeBatches - finalize the state, marking L1 -> L2 communication processing, and saving Merkle tree with L2 logs. Each L2 -> L1 system log will have a key that is part of the following: enum SystemLogKey { L2_TO_L1_LOGS_TREE_ROOT_KEY, TOTAL_L2_TO_L1_PUBDATA_KEY, STATE_DIFF_HASH_KEY, PACKED_BATCH_AND_L2_BLOCK_TIMESTAMP_KEY, PREV_BATCH_HASH_KEY, CHAINED_PRIORITY_TXN_HASH_KEY, NUMBER_OF_LAYER_1_TXS_KEY, EXPECTED_SYSTEM_CONTRACT_UPGRADE_TX_HASH_KEY
} When a batch is committed, we process L2 -> L1 system logs. Here are the invariants that are expected there: In a given batch there will be either 7 or 8 system logs. The 8th log is only required for a protocol upgrade. There will be a single log for each key that is contained within SystemLogKey Three logs from the L2_TO_L1_MESSENGER with keys: L2_TO_L1_LOGS_TREE_ROOT_KEY TOTAL_L2_TO_L1_PUBDATA_KEY STATE_DIFF_HASH_KEY Two logs from L2_SYSTEM_CONTEXT_SYSTEM_CONTRACT_ADDR with keys: PACKED_BATCH_AND_L2_BLOCK_TIMESTAMP_KEY PREV_BATCH_HASH_KEY Two or three logs from L2_BOOTLOADER_ADDRESS with keys: CHAINED_PRIORITY_TXN_HASH_KEY NUMBER_OF_LAYER_1_TXS_KEY EXPECTED_SYSTEM_CONTRACT_UPGRADE_TX_HASH_KEY None logs from other addresses (may be changed in the future). DiamondInit It is a one-function contract that implements the logic of initializing a diamond proxy. It is called only once on the diamond constructor and is not saved in the diamond as a facet. Implementation detail - function returns a magic value just like it is designed in EIP-1271 , but the magic value is 32 bytes in size.

