At the end of the execution of the batch, the bootloader provides the L1Messenger with the preimages for the user L2→L1 logs, L2→L1 long messages as well as uncompressed bytecodes. It also provides with compressed state diffs as well as the original expanded state diff entries. It will check that the preimages are correct as well as the fact that the compression is correct. It will output the following three values via system logs: The root of the L2→L1 log Merkle tree. It will be stored and used for proving withdrawals. The hash of the totalPubdata (i.e. the pubdata that contains the preimages above as well as packed state diffs). The hash of the state diffs provided by the operator (it later on be included in the block commitment and its will be enforced by the circuits). The totalPubdata has the following structure: First 4 bytes — the number of user L2→L1 logs in the batch Then, the concatenation of packed L2→L1 user logs. Next, 4 bytes — the number of long L2→L1 messages in the batch. Then, the concatenation of L2→L1 messages, each in the format of <4 byte length || actual_message>. Next, 4 bytes — the number of uncompressed bytecodes in the batch. Then, the concatenation of uncompressed bytecodes, each in the format of <4 byte length || actual_bytecode>. Next, 4 bytes — the length of the compressed state diffs. Then, state diffs are compressed by the spec above . With Boojum, the interface for committing batches is the following one: /// @notice Data needed to commit new batch
/// @param batchNumber Number of the committed batch
/// @param timestamp Unix timestamp denoting the start of the batch execution
/// @param indexRepeatedStorageChanges The serial number of the shortcut index that's used as a unique identifier for storage keys that were used twice or more
/// @param newStateRoot The state root of the full state tree
/// @param numberOfLayer1Txs Number of priority operations to be processed
/// @param priorityOperationsHash Hash of all priority operations from this batch
/// @param bootloaderHeapInitialContentsHash Hash of the initial contents of the bootloader heap. In practice it serves as the commitment to the transactions in the batch.
/// @param eventsQueueStateHash Hash of the events queue state. In practice it serves as the commitment to the events in the batch.
/// @param systemLogs concatenation of all L2 -> L1 system logs in the batch
/// @param totalL2ToL1Pubdata Total pubdata committed to as part of bootloader run. Contents are: l2Tol1Logs <> l2Tol1Messages <> publishedBytecodes <> stateDiffs
struct CommitBatchInfo { uint64 batchNumber; uint64 timestamp; uint64 indexRepeatedStorageChanges; bytes32 newStateRoot; uint256 numberOfLayer1Txs; bytes32 priorityOperationsHash; bytes32 bootloaderHeapInitialContentsHash; bytes32 eventsQueueStateHash; bytes systemLogs; bytes totalL2ToL1Pubdata;
}

