Precompile for computing elliptic curve point addition. The points are represented in affine form, given by a pair of coordinates $(x,y)$. Affine coordinates are the conventional way of expressing elliptic curve points, which use 2 coordinates. The math is concise and easy to follow. For a pair of constants $a$ and $b$, an elliptic curve is defined by the set of all points $(x,y)$ that satisfy the equation $y^2=x^3+ax+b$, plus a special “point at infinity” named $O$. Point Doubling To compute $2P$ (or $P+P$), there are three cases: If $P = O$, then $2P = O$. Else $P = (x, y)$ If $y = 0$, then $2P = O$. Else $y≠0$, then $$  egin{gather*} \lambda =  rac{3x_{p}^{2} + a}{2y_{p}} \ x_{r} = \lambda^{2} - 2x_{p} \ y_{r} = \lambda(x_{p} - x_{r}) - y_{p}\end{gather*} $$ The complicated case involves approximately 6 multiplications, 4 additions/subtractions, and 1 division. There could also be 4 multiplications, 6 additions/subtractions, and 1 division, and if you want you could trade a multiplication with 2 more additions. Point Addition To compute $P + Q$ where $P 
eq Q$, there are four cases: If $P = 0$ and $Q 
eq 0$, then $P + Q = Q$. If $Q = 0$ and $P 
eq 0$, then $P + Q = P$. Else $P = (x_{p},\ y_{p})$ and$Q = (x_{q},\ y_{q})$ If $x_{p} = x_{q}$ (and necessarily $y_{p} 
eq y_{q}$), then $P + Q = O$. Else $x_{p} 
eq x_{q}$, then $$  egin{gather*} \lambda =  rac{y_{2} - y_{1}}{x_{2} - x_{1}} \ x_{r} = \lambda^{2} - x_{p} - x_{q} \ y_{r} = \lambda(x_{p} - x_{r}) - y_{p}\end{gather*} $$ and $P + Q = R = (x_{r},\ y_{r})$. The complicated case involves approximately 2 multiplications, 6 additions/subtractions, and 1 division.

