Interop Calls are the next level of interfaces, built on top of Interop Messages, enabling you to call contracts on other chains. interopcall.png At this level, the system handles replay protection—once a call is successfully executed, it cannot be executed again (eliminating the need for your own nullifiers or similar mechanisms). Additionally, these calls originate from aliased accounts, simplifying permission management (more details on this below). Cancellations and retries are managed at the next level (Bundles), which are covered in the following section. Interface On the sending side, the interface provides the option to send this "call" to the destination contract. struct InteropCall { address sourceSender, address destinationAddress, uint256 destinationChainId, calldata data, uint256 value
}
contract InteropCenter { // On source chain. // Sends a 'single' basic internal call to destination chain & address. // Internally, it starts a bundle, adds this call and sends it over. function sendCall(destinationChain, destinationAddress, calldata, msgValue) returns bytes32 bundleId;
} In return, you receive a bundleId (we’ll explain bundles later, but for now, think of it as a unique identifier for your call). On the destination chain, you can execute the call using the execute method: contract InteropCenter { // Executes a given bundle. // interopMessage is the message that contains your bundle as payload. // If it fails, it can be called again. function executeInteropBundle(interopMessage, proof); // If the bundle didn't execute succesfully yet, it can be marked as cancelled. // See details below. function cancelInteropBundle(interopMessage, proof);
} You can retrieve the interopMessage (which contains your entire payload) from the Gateway, or you can construct it yourself using L1 data. Under the hood, this process calls the destinationAddress with the specified calldata. This leads to an important question: Who is the msg.sender for this call?

