contract Shop { /// Called by the customers when they buy something. function buy(uint256 itemPrice) { // handle payment etc. ... // report to HQ InteropCenter(INTEROP_ADDRESS).sendCall( 324, // chain id of chain A, 0xc425.., // HQ contract on chain A, createCalldata("reportSales(uint256)", itemPrice), // calldata 0, // no value ); }
} // Deployed on chain A
contract HQ { // List of shops mapping (address => bool) shops; mapping (address => uint256) sales; function addShop(address addressOnChain, uint256 chainId) onlyOwner { // Adding aliased accounts. shops[address(keccak(addressOnChain || chainId))] = true; } function reportSales(uint256 itemPrice) { // only allow calls from our shops (their aliased accounts). require(shops[msg.sender]); sales[msg.sender] += itemPrice; }
} Who is paying for gas? How does this Call get to the destination chain At this level, the InteropCall acts like a hitchhiker — it relies on someone (anyone) to pick it up, execute it, and pay for the gas! callride.png While any transaction on the destination chain can simply call InteropCenter.executeInteropBundle, if you don’t want to rely on hitchhiking, you can create one yourself. We’ll discuss this in the section about Interop Transactions .

