Before we proceed to discuss InteropTransactions , there is one more layer in between: InteropBundles . interopcallbundle.png Bundles Offer: Shared Fate : All calls in the bundle either succeed or fail together. Retries : If a bundle fails, it can be retried (e.g., with more gas). Cancellations : If a bundle has not been successfully executed yet, it can be cancelled. If you look closely at the interface we used earlier, you’ll notice that we were already discussing the execution of Bundles rather than single calls. So, let’s dive into what bundles are and the role they fulfill. The primary purpose of a bundle is to ensure that a given list of calls is executed in a specific order and has a shared fate (i.e., either all succeed or all fail). In this sense, you can think of a bundle as a "multicall" , but with two key differences: You cannot "unbundle" items—an individual InteropCall cannot be run independently; it is tightly tied to the bundle. Each InteropCall within a bundle can use a different aliased account, enabling separate permissions for each call. contract InteropCenter { struct InteropBundle { // Calls have to be done in this order. InteropCall calls[]; uint256 destinationChain; // If not set - anyone can execute it. address executionAddresses[]; // Who can 'cancel' this bundle. address cancellationAddress; } // Starts a new bundle. // All the calls that will be added to this bundle (potentially by different contracts) // will have a 'shared fate'. // The whole bundle must be going to a single destination chain. function startBundle(destinationChain) returns bundleId; // Adds a new call to the opened bundle. // Returns the messageId of this single message in the bundle. function addToBundle(bundleId, destinationAddress, calldata, msgValue) return msgHash; // Finishes a given bundle, and sends it. function finishAndSendBundle(bundleId) return msgHash;
} Cross Chain Swap Example Imagine you want to perform a swap on chain B, exchanging USDC for PEPE, but all your assets are currently on chain A. This process would typically involve four steps: Transfer USDC from chain A to chain B. Set allowance for the swap. Execute the swap. Transfer PEPE back to chain A. Each of these steps is a separate "call," but you need them to execute in exactly this order and, ideally, atomically. If the swap fails, you wouldn’t want the allowance to remain set on the destination chain. Below is an example of how this process could look (note that the code is pseudocode; we’ll explain the helper methods required to make it work in a later section). bundleId = InteropCenter(INTEROP_CENTER).startBundle(chainD);
// This will 'burn' the 1k USDC, create the special interopCall
// when this call is executed on chainD, it will mint 1k USDC there.
// BUT - this interopCall is tied to this bundle id.
USDCBridge.transferWithBundle( bundleId, chainD, aliasedAccount(this(account), block.chain_id), 1000); // This will create interopCall to set allowance.
InteropCenter.addToBundle(bundleId, USDCOnDestinationChain, createCalldata("approve", 1000, poolOnDestinationChain), 0);
// This will create interopCall to do the swap.
InteropCenter.addToBundle(bundleId, poolOnDestinationChain, createCalldata("swap", "USDC_PEPE", 1000, ...), 0)
// And this will be the interopcall to transfer all the assets back.
InteropCenter.addToBundle(bundleId, pepeBridgeOnDestinationChain, createCalldata("transferAll", block.chain_id, this(account)), 0) bundleHash = interopCenter.finishAndSendBundle(bundleId); In the code above, we created a bundle that anyone can execute on the destination chain. This bundle will handle the entire process: minting, approving, swapping, and transferring back. Bundle Restrictions When starting a bundle, if you specify the executionAddress, only that account will be able to execute the bundle on the destination chain. If no executionAddress is specified, anyone can trigger the execution.

